namespace Pds.Contracts.ContractEventProcessor.Services.Tests.Unit
{
    [TestClass, TestCategory("Unit")]
    public class ContractCreationServiceTests
    {
        private readonly IContractEventProcessorLogger<IContractCreationService> _mockLogger
           = Mock.Of<IContractEventProcessorLogger<IContractCreationService>>(MockBehavior.Strict);

        private readonly IContractsDataService _mockContractsDataService
           = Mock.Of<IContractsDataService>(MockBehavior.Strict);

        private readonly ISharePointClientService _mockSharePointClientService
           = Mock.Of<ISharePointClientService>(MockBehavior.Strict);

        private readonly IDocumentManagementService _mockDocumentManagementService
           = Mock.Of<IDocumentManagementService>(MockBehavior.Strict);

        private readonly IContractEventMapper _mockContractProcessorService
            = Mock.Of<IContractEventMapper>(MockBehavior.Strict);

        private readonly IOptions<SPClientServiceConfiguration> _mockSPClientServiceConfiguration
            = Mock.Of<IOptions<SPClientServiceConfiguration>>(MockBehavior.Strict);

        [TestMethod]
        public async Task Create_ExpectedResult()
        {
            //Arrange
            ContractEvent dummyContractEvent = GetContractEvent();
            SetMockSetup_Logger(LogLevel.Information);
            var dummyPdf = GetPdf_Byte();
            SetMockSetup_SharePointClientService(dummyPdf);
            SetMockSetup_Create(dummyContractEvent);
            var contractCreationService = GetContractCreationService();

            //Act
            var result = await contractCreationService.CreateAsync(dummyContractEvent);

            //Assert
            result.Should().BeTrue();
            Mock.Get(_mockContractProcessorService).Verify(x => x.GetCreateRequest(dummyContractEvent), Times.Once);
            Mock.Get(_mockContractProcessorService).Verify(x => x.GetFileNameForContractDocument(It.IsAny<int?>(), It.IsAny<string>(), It.IsAny<int>()), Times.Once);
            Mock.Get(_mockContractProcessorService).Verify(x => x.GetFolderNameForContractDocument(It.IsAny<string>(), It.IsAny<string>(), It.IsAny<string>()), Times.Once);
            Mock.Get(_mockContractProcessorService).Verify(x => x.GetUrlSafeFolderNameForContractDocument(It.IsAny<string>()), Times.Once);
            Mock.Get(_mockContractProcessorService).Verify(x => x.GetContractContent(It.IsAny<byte[]>(), It.IsAny<string>()), Times.Once);
            Mock.Get(_mockSharePointClientService).Verify(x => x.GetDocument(It.IsAny<string>(), It.IsAny<string>()), Times.Once);
            Mock.Get(_mockDocumentManagementService).Verify(x => x.ConvertToPdfA(It.IsAny<byte[]>()), Times.Once);
            Mock.Get(_mockContractsDataService).Verify(x => x.CreateContractAsync(It.IsAny<CreateRequest>()), Times.Once);
            Mock.Get(_mockSPClientServiceConfiguration).VerifyAll();
            Mock.Get(_mockLogger).VerifyAll();
        }

        [TestMethod]
        public void Create_Expected_DocumentNotFoundException()
        {
            //Arrange
            ContractEvent dummyContractEvent = GetContractEvent();
            SetMockSetup_Logger(LogLevel.Information);
            SetMockSetup_Create(dummyContractEvent);
            SetMockSetup_SharePointClientService_TException<DocumentNotFoundException>(new DocumentNotFoundException(It.IsAny<string>()));
            var contractCreationService = GetContractCreationService();

            //Act
            Func<Task> act = async () => await contractCreationService.CreateAsync(dummyContractEvent);

            //Assert
            act.Should().Throw<DocumentNotFoundException>();
            Mock.Get(_mockSharePointClientService).Verify(x => x.GetDocument(It.IsAny<string>(), It.IsAny<string>()), Times.Once);
            Mock.Get(_mockDocumentManagementService).Verify(x => x.ConvertToPdfA(It.IsAny<byte[]>()), Times.Never);
            Mock.Get(_mockContractsDataService).Verify(x => x.CreateContractAsync(It.IsAny<CreateRequest>()), Times.Never);
            Mock.Get(_mockLogger).VerifyAll();
        }

        [TestMethod]
        public void Create_Expected_DocumentNotAccessibleException()
        {
            //Arrange
            ContractEvent dummyContractEvent = GetContractEvent();
            SetMockSetup_Logger(LogLevel.Information);
            SetMockSetup_Create(dummyContractEvent);
            SetMockSetup_SharePointClientService_TException<DocumentNotAccessibleException>(new DocumentNotAccessibleException(It.IsAny<string>()));
            var contractCreationService = GetContractCreationService();

            //Act
            Func<Task> act = async () => await contractCreationService.CreateAsync(dummyContractEvent);

            //Assert
            act.Should().Throw<DocumentNotAccessibleException>();
            Mock.Get(_mockSharePointClientService).Verify(x => x.GetDocument(It.IsAny<string>(), It.IsAny<string>()), Times.Once);
            Mock.Get(_mockDocumentManagementService).Verify(x => x.ConvertToPdfA(It.IsAny<byte[]>()), Times.Never);
            Mock.Get(_mockContractsDataService).Verify(x => x.CreateContractAsync(It.IsAny<CreateRequest>()), Times.Never);
            Mock.Get(_mockLogger).VerifyAll();
        }

        private ContractCreationService GetContractCreationService()
        {
            return new ContractCreationService(_mockLogger, _mockContractsDataService, _mockSharePointClientService, _mockDocumentManagementService, _mockContractProcessorService, _mockSPClientServiceConfiguration);
        }

        private void SetMockSetup_Create(ContractEvent dummyContractEvent)
        {
            var dummyPdfA = GetPdfA_Byte();
            var dummyCreateRequest = GetCreateRequest();
            var expectedFileName = "Test.pdf";
            var expectedFolderName = "TestFolder";
            var expectedUrlFolderName = "TestFolder";
            var createContractRequestDocument = GetCreateContractRequestDocument();
            var spClientServiceConfiguration = new SPClientServiceConfiguration();
            Mock.Get(_mockContractProcessorService)
                .Setup(x => x.GetCreateRequest(dummyContractEvent))
                .Returns(dummyCreateRequest)
                .Verifiable();
            Mock.Get(_mockContractProcessorService)
               .Setup(x => x.GetFileNameForContractDocument(It.IsAny<int?>(), It.IsAny<string>(), It.IsAny<int>()))
               .Returns(expectedFileName)
               .Verifiable();
            Mock.Get(_mockContractProcessorService)
               .Setup(x => x.GetFolderNameForContractDocument(It.IsAny<string>(), It.IsAny<string>(), It.IsAny<string>()))
               .Returns(expectedFolderName)
               .Verifiable();
            Mock.Get(_mockContractProcessorService)
               .Setup(x => x.GetUrlSafeFolderNameForContractDocument(It.IsAny<string>()))
               .Returns(expectedUrlFolderName)
               .Verifiable();
            Mock.Get(_mockContractProcessorService)
              .Setup(x => x.GetContractContent(It.IsAny<byte[]>(), It.IsAny<string>()))
              .Returns(createContractRequestDocument)
              .Verifiable();

            Mock.Get(_mockSPClientServiceConfiguration)
                .Setup(x => x.Value)
                .Returns(spClientServiceConfiguration)
                .Verifiable();

            Mock.Get(_mockDocumentManagementService)
               .Setup(x => x.ConvertToPdfA(It.IsAny<byte[]>()))
               .Returns(dummyPdfA)
               .Verifiable();
            Mock.Get(_mockContractsDataService)
                .Setup(x => x.CreateContractAsync(It.IsAny<CreateRequest>()))
                .Returns(Task.CompletedTask)
                .Verifiable();
        }

        private void SetMockSetup_SharePointClientService(byte[] dummyPdf)
        {
            Mock.Get(_mockSharePointClientService)
                .Setup(x => x.GetDocument(It.IsAny<string>(), It.IsAny<string>()))
                .ReturnsAsync(dummyPdf)
                .Verifiable();
        }

        private void SetMockSetup_SharePointClientService_TException<TException>(TException exception)
            where TException : Exception
        {
            Mock.Get(_mockSharePointClientService)
                .Setup(x => x.GetDocument(It.IsAny<string>(), It.IsAny<string>()))
                .Throws(exception)
                .Verifiable();
        }

        private void SetMockSetup_Logger(LogLevel logLevel)
        {
            switch (logLevel)
            {
                case LogLevel.Information:
                    Mock.Get(_mockLogger).Setup(logger => logger.LogInformation(It.IsAny<string>()));
                    break;

                case LogLevel.Warning:
                    Mock.Get(_mockLogger).Setup(logger => logger.LogWarning(It.IsAny<string>()));
                    break;

                case LogLevel.Error:
                    Mock.Get(_mockLogger).Setup(logger => logger.LogError(It.IsAny<string>()));
                    break;

                default:
                    break;
            }
        }

        private ContractEvent GetContractEvent()
        {
            var contractEvent = new ContractEvent();
            contractEvent.AmendmentType = ContractAmendmentType.Variation;

            contractEvent.ContractAllocations = Enumerable.Repeat(0, 2).Select(h =>
                    new ContractAllocation { FundingStreamPeriodCode = $"Test{h}", ContractAllocationNumber = "TestAllocNo", LEPArea = "TestLEP", TenderSpecTitle = "TestSpec" }).ToArray();
            contractEvent.ContractNumber = "Levy-0001";
            contractEvent.Type = ContractType.TwentyFourPlusAdvancedLearningLoanEoi.ToString();
            contractEvent.ContractVersion = 1;
            contractEvent.EndDate = DateTime.Now.AddMonths(36);
            contractEvent.FundingType = ContractFundingType.Levy;
            contractEvent.ParentContractNumber = "Test123";
            contractEvent.StartDate = DateTime.Now;
            contractEvent.UKPRN = 12345678;
            contractEvent.Value = 99999;
            contractEvent.ContractEventXml = "sample-blob-file.xml";
            contractEvent.ContractPeriodValue = "1799";
            contractEvent.BookmarkId = Guid.NewGuid();
            return contractEvent;
        }

        private CreateRequest GetCreateRequest()
        {
            return new CreateRequest();
        }

